void OAITaskrouterV1WorkerApi::updateWorker(const QString &workspace_sid, const QString &sid, const ::OpenAPI::OptionalParam<QString> &if_match, const ::OpenAPI::OptionalParam<QString> &activity_sid, const ::OpenAPI::OptionalParam<QString> &attributes, const ::OpenAPI::OptionalParam<QString> &friendly_name, const ::OpenAPI::OptionalParam<bool> &reject_pending_reservations) {
    QString fullPath = QString(_serverConfigs["updateWorker"][_serverIndices.value("updateWorker")].URL()+"/v1/Workspaces/{WorkspaceSid}/Workers/{Sid}");
    
    if (!_username.isEmpty() && !_password.isEmpty()) {
        QByteArray b64;
        b64.append(_username.toUtf8() + ":" + _password.toUtf8());
        addHeaders("Authorization","Basic " + b64.toBase64());
    }
    
    {
        QString workspace_sidPathParam("{");
        workspace_sidPathParam.append("WorkspaceSid").append("}");
        QString pathPrefix, pathSuffix, pathDelimiter;
        QString pathStyle = "simple";
        if (pathStyle == "")
            pathStyle = "simple";
        pathPrefix = getParamStylePrefix(pathStyle);
        pathSuffix = getParamStyleSuffix(pathStyle);
        pathDelimiter = getParamStyleDelimiter(pathStyle, "WorkspaceSid", false);
        QString paramString = (pathStyle == "matrix") ? pathPrefix+"WorkspaceSid"+pathSuffix : pathPrefix;
        fullPath.replace(workspace_sidPathParam, paramString+QUrl::toPercentEncoding(::OpenAPI::toStringValue(workspace_sid)));
    }
    
    {
        QString sidPathParam("{");
        sidPathParam.append("Sid").append("}");
        QString pathPrefix, pathSuffix, pathDelimiter;
        QString pathStyle = "simple";
        if (pathStyle == "")
            pathStyle = "simple";
        pathPrefix = getParamStylePrefix(pathStyle);
        pathSuffix = getParamStyleSuffix(pathStyle);
        pathDelimiter = getParamStyleDelimiter(pathStyle, "Sid", false);
        QString paramString = (pathStyle == "matrix") ? pathPrefix+"Sid"+pathSuffix : pathPrefix;
        fullPath.replace(sidPathParam, paramString+QUrl::toPercentEncoding(::OpenAPI::toStringValue(sid)));
    }
    OAIHttpRequestWorker *worker = new OAIHttpRequestWorker(this, _manager);
    worker->setTimeOut(_timeOut);
    worker->setWorkingDirectory(_workingDirectory);
    OAIHttpRequestInput input(fullPath, "POST");

    if (activity_sid.hasValue())
    {
        input.add_var("ActivitySid", ::OpenAPI::toStringValue(activity_sid.value()));
    }
    if (attributes.hasValue())
    {
        input.add_var("Attributes", ::OpenAPI::toStringValue(attributes.value()));
    }
    if (friendly_name.hasValue())
    {
        input.add_var("FriendlyName", ::OpenAPI::toStringValue(friendly_name.value()));
    }
    if (reject_pending_reservations.hasValue())
    {
        input.add_var("RejectPendingReservations", ::OpenAPI::toStringValue(reject_pending_reservations.value()));
    }

    if (if_match.hasValue())
    {
        if (!::OpenAPI::toStringValue(if_match.value()).isEmpty()) {
            input.headers.insert("If-Match", ::OpenAPI::toStringValue(if_match.value()));
        }
        }
    for (auto keyValueIt = _defaultHeaders.keyValueBegin(); keyValueIt != _defaultHeaders.keyValueEnd(); keyValueIt++) {
        input.headers.insert(keyValueIt->first, keyValueIt->second);
    }


    connect(worker, &OAIHttpRequestWorker::on_execution_finished, this, &OAITaskrouterV1WorkerApi::updateWorkerCallback);
    connect(this, &OAITaskrouterV1WorkerApi::abortRequestsSignal, worker, &QObject::deleteLater);
    connect(worker, &QObject::destroyed, this, [this]() {
        if (findChildren<OAIHttpRequestWorker*>().count() == 0) {
            Q_EMIT allPendingRequestsCompleted();
        }
    });

    worker->execute(&input);
}

